import styled from "styled-components";
interface PostProps {
  currentTab: number;
}
const Post: React.FC<PostProps> = ({ currentTab }) => {
  return <Container>Post</Container>;
};
export default Post;

const Container = styled.div`
  display: flex;
  flex-direction: column;
`;
